import logo from './logo.svg';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Routes,
  Link
} from "react-router-dom";

import Top from "./components/Top.js";
import Home from "./pages/Home";

import './App.css';

function App() {
  return (
    <div className="App">
      <Top/>
      <Router>
        <Routes>
          <Route path="/" element={<Home/>}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
